description:
Jip en Janneke standbeeld te Zaltbommel.Onder de titel Jip en Janneke schreef Annie M.G. Schmidt diverse kinderverhalen. De verhaaltjes, die als wekelijkse afleveringen in het dagblad Het Parool verschenen, gaan over het dagelijks leven van twee buurkinderen: Jip en Janneke. Zij beleven van alles: ze worden jarig, stampen in de regenplassen, gaan op bezoek bij oma, maken een legpuzzel en doen de poppenwas. De hond Takkie en de poes Siepie zijn belangrijke nevenfiguren. Ook moeder komt er vaak in voor, zij grijpt nogal eens in met de woorden Dat mag volstrekt niet!



